// File: DashboardPage.js
import React from 'react';
import { Link } from 'react-router-dom';
import './DashboardPage.css'; // Import your CSS file
import CourseList from './CourseList'; // Import your CourseList component

const enrolledCourses = [
  { title: 'Course 1', description: 'Description for Course 1' },
  { title: 'Course 2', description: 'Description for Course 2' },
  // Add more enrolled courses here
];

const availableCourses = [
  { title: 'Course A', description: 'Description for Course A' },
  { title: 'Course B', description: 'Description for Course B' },
  // Add more available courses here
];

function DashboardPage() {
  return (
    <div>
      <nav className="top-navbar">
        <div className="navbar-logo">MyApp</div>
        <div className="navbar-links">
          <Link to="/dashboard" className="navbar-link">Dashboard</Link>
          <Link to="/register" className="navbar-link">Sign Up</Link>
          <Link to="/login" className="navbar-link">Login</Link>
        </div>
      </nav>
      <div className="dashboard-container">
        <h1 className="dashboard-header">Dashboard Page</h1>
        <CourseList title="Enrolled Courses" courses={enrolledCourses} />
        <CourseList title="Available Courses" courses={availableCourses} />
      </div>
    </div>
  );
}

export default DashboardPage;
